// SPDX-License-Identifier: MIT
pragma solidity ^0.8.12;

contract BloodDonationSystem {

    /* -------------------- STRUCTS -------------------- */

    struct Donor {
        bytes32 donorId;
        string bloodGroup;
        bool requested;
        bool eligible;
        bool donated;
    }

    struct TestResult {
        bool tested;
        bool passed;
    }

    struct BloodUnit {
        bool sentToBank;
        bool verified;
        bool sentToAuthority;
    }

    /* -------------------- STORAGE -------------------- */

    mapping(bytes32 => Donor) public donors;
    mapping(bytes32 => TestResult) public testResults;
    mapping(bytes32 => BloodUnit) public bloodUnits;

    /* -------------------- EVENTS (TRACEABILITY) -------------------- */

    event DonationRequested(bytes32 donorId);
    event TestScheduled(bytes32 donorId, uint256 time);
    event TestResultSent(bytes32 donorId, bool passed);
    event DonorAccepted(bytes32 donorId);
    event DonorRejected(bytes32 donorId);
    event BloodSentToBank(bytes32 donorId);
    event BloodVerified(bytes32 donorId);
    event DataSentToAuthority(bytes32 donorId);
    event GovernmentDataStored(bytes32 donorId);
    event BloodInTransit(bytes32 donorId);

    /* -------------------- DONOR -------------------- */

    function requestDonation(bytes32 donorId, string memory bloodGroup) public {
        donors[donorId] = Donor(donorId, bloodGroup, true, false, false);
        emit DonationRequested(donorId);
    }

    /* -------------------- LAB AUTHORITY -------------------- */

    function sendTestResult(bytes32 donorId, bool passed) public {
        testResults[donorId] = TestResult(true, passed);
        emit TestResultSent(donorId, passed);
    }

    /* -------------------- HOSPITAL -------------------- */

    function hospitalDecision(bytes32 donorId) public {
        require(testResults[donorId].tested, "Test not done");

        if (testResults[donorId].passed) {
            donors[donorId].eligible = true;
            emit DonorAccepted(donorId);
        } else {
            emit DonorRejected(donorId);
        }
    }

    function sendBloodToBank(bytes32 donorId) public {
        require(donors[donorId].eligible, "Donor not eligible");
        bloodUnits[donorId].sentToBank = true;
        emit BloodSentToBank(donorId);
        emit BloodInTransit(donorId);
    }

    /* -------------------- BLOOD BANK -------------------- */

    function verifyBlood(bytes32 donorId) public {
        require(bloodUnits[donorId].sentToBank, "Blood not received");
        bloodUnits[donorId].verified = true;
        emit BloodVerified(donorId);
    }

    function sendToHealthAuthority(bytes32 donorId) public {
        require(bloodUnits[donorId].verified, "Blood not verified");
        bloodUnits[donorId].sentToAuthority = true;
        emit DataSentToAuthority(donorId);
    }

    /* -------------------- HEALTH AUTHORITY -------------------- */

    function storeGovernmentData(bytes32 donorId) public {
        require(bloodUnits[donorId].sentToAuthority, "Data not received");
        emit GovernmentDataStored(donorId);
    }
}
